var No=function(r){this.dado=r,this.esq=this.dir=null};function inserir(r,i){if(r){var n=void 0;return i<=r.dado?(n=inserir(r.esq,i),r.esq=n):(n=inserir(r.dir,i),r.dir=n),r}return new No(i)}function printMenores(r){for(var i=r,n=0;i;)i.dado,n++,i=i.esq;return n}function printMaiores(r){for(var i=r,n=0;i;)i.dado,n++,i=i.dir;return n}function getAltura(r){if(!r)return-1;var i=getAltura(r.esq),n=getAltura(r.dir);return(i<n?n:i)+1}for(var T=[3,5,2,1,4,6,7],raiz=null,i=0;i<T.length;i++)raiz=inserir(raiz,T[i]);console.log("Altura: "+getAltura(raiz));